import React from "react";
import "Navbar.css";

function Navbar() {
	return (
		<nav class="navbar">
			<div class="title">
				<h3>naail lakhani</h3>
			</div>
			<div class="navbar-items">
				<h3>writing</h3>
				<h3>experience</h3>
			</div>
		</nav>
	);
}

export default Navbar;
